import React from "react";
import { useNavigate } from "react-router-dom";
import PieChartComponent from "./PieChartComponent";
import BarChartComponent from "./BarChartComponent";
import RouteLineChart from "./RouteLineChart";
import AgeGroupDetails from "./AgeGroupDetails";

function Dashboard() {
  const navigate = useNavigate();

  return (
    <div style={{ padding: "2rem" }}>
      <h1 style={{ textAlign: "center", fontSize: "2rem", fontWeight: "bold" }}>
        ‚úàÔ∏è In-Flight Insights Dashboard
      </h1>

      <div style={{ display: "flex", justifyContent: "center", marginTop: "1rem" }}>
        <button
          onClick={() => navigate("/sop")}
          style={{
            padding: "10px 20px",
            fontSize: "1rem",
            backgroundColor: "#16a34a",
            color: "white",
            border: "none",
            borderRadius: "8px",
            cursor: "pointer"
          }}
        >
          üìã Inventory Recommendations
        </button>
      </div>

      <div style={{ marginTop: "2rem" }}>
        <h2>Overall Food Consumption</h2>
        <PieChartComponent />
      </div>

      <div>
        <h2>Waste by Age Group</h2>
        <BarChartComponent />
      </div>

      <div>
        <h2>Route-Specific Waste Trend</h2>
        <RouteLineChart />
      </div>

      <div>
        <h2>Age Group Details</h2>
        <p>[Details will be shown here on click of bar chart]</p>
        <AgeGroupDetails />
      </div>
    </div>
  );
}

export default Dashboard;
